  Form,
  Select,
  InputNumber,
  DatePicker,
  Switch,
  Slider,
  Button,
  Input,
} from "antd";
import Link from "next/link";
import Speechtotext from "./component.speechtotext";
import { useSelector } from "react-redux";

const FormItem = Form.Item;
function ShowProfile() {
  const { FirstName, LastName, SSID, PostId, BirdDay } = useSelector(
    (state) => state.post
  );
  const keyword = ["ใช่"];
  return (
      <div
        style={{
          display: "flex",
          flexDirection: "row",
          width: "100%",
          height: "100%",
          justifyContent: "center",
          alignItems: "center",
          background:"red"
        }}
      >
        <div
          style={{
            display: "flex",
            flexBasis: "70%",
            padding: "10px",
            justifyContent: "flex-end",
            alignItems: "center",
            width: "100%",
            height: "100%",
          }}
        >
          <div
            style={{
              width: "250px",
              height: "250px",
              background: "white",
              borderRadius: "68px",
              marginRight: "50px",
            }}
          />
        </div>
        <div
          style={{
            display: "flex",
            flexBasis: "auto",
            flexDirection: "column",
            padding: "10px",
            width: "100%",
            height: "100%",
          }}
        >
          <Speechtotext
            speech={"/page.covidquestion"}
            keyword={keyword}
            page={"covid4"}
          />
          <h3 style={{ fontSize: "18px", margin: " 10px 0px 0px 20px " }}>
            ชื่อ สกุล
          </h3>
          <div className="nu-box-covid4">{FirstName + " " + LastName}</div>
          {/*<h3 style={{ fontSize: "18px",margin:" 10px 0px 0px 20px " }}>หมายเลขประจำตัวประชาชน</h3>
          <div className="nu-box-covid4">{SSID}</div>
          <h3 style={{ fontSize: "18px",margin:" 10px 0px 0px 20px " }}>วัน เดือน ปีเกิด</h3>
          <div className="nu-box-covid4">{BirdDay}</div>
          <h3 style={{ fontSize: "18px",margin:" 10px 0px 0px 20px " }}>รหัสไปรษณีย์</h3>
          <div className="nu-box-covid4">{PostId}</div>
          <h3 style={{ fontSize: "18px",margin:" 10px 0px 0px 20px " }}>อุณหภูมิร่างกาย</h3>
        <div className="nu-box-covid4">{PostId}</div>*/}
        </div>
      </div>
  );
}
export default ShowProfile;
